/* ================ PAGERESULT ================ */
.page_result{
  margin: 0;
  padding: 0;
  height: 100%;
  width: 100%;
  box-sizing: border-box;
}
.page_result{
  display: flex;
  flex-flow: column nowrap;
  justify-content: space-between;
  align-items: stretch;
}
/**** FLEX CONTENT PAGE ****/
.page_result:first-child{
  flex: 2 1 220px;
}
.page_result:nth-child(2){
  flex: 4 0 490px;
}
.page_result:last-child{
  flex: 1 3 200px;
}

/* ================ HEADER TITLE ================ */
.head_result{
  text-align: center;
}
.head_result .title_result{
  font-family: "Asap_bold";
  font-size: 2.8rem;
  color: var(--primary-color);
}
.head_result .lead_result{
  font-size: 1rem;
  color: var(--main-ft-color);
}

/* ================ BTN BACK ================ */
/* IDEM VALID */
button.btn_site{
  display: block;
  margin: 1rem auto;
  font-family: "Asap_bold";
  text-transform: uppercase;
  letter-spacing: .1rem;
  padding: .75rem 2.5rem;
  border-radius: 1.25rem/50%;
  font-size: 1rem;
  background-color: var(--primary-color);
  color: var(--main-bg-color);
  cursor: pointer;
  border: 1px solid var(--main-bg-color);
}
button.btn_site:hover{
  background-color: var(--secondary-color);
  color: var(--primary-color);
  border: 1px solid var(--primary-color);
}
.btn_site a{
  text-decoration: none;
  color: inherit;
}

/* ================ CONTENT RESULT ================ */
.content_result{
  background-color: var(--secondary-color);
  height: 100%;
  display: flex;
  flex-flow: column nowrap;
  justify-content: flex-start;
  align-items: center;
}

/* ======= BADGE ======= */
.badge_box{
  flex: 0 1 100px;
}
.badge_box .badge{
  font-family: "Asap_bold";
  font-size: 2.4rem;
  color: var(--main-ft-color);
  text-align: center;
  margin: 1.5rem auto 0;
}
/* ======= RADAR ======= */
.diag_box{
  flex: 2 1 250px;
}

.radarChart{
  font-size: 1.2rem;
	font-weight: 300;
	fill: #242424;
	text-align: center;
	text-shadow: 0 1px 0 #fff, 1px 0 0 #fff, -1px 0 0 #fff, 0 -1px 0 #fff;
	cursor: default;
}
.legend {
	font-family: 'Raleway', sans-serif;
	fill: #333333;
}

.tooltip {
	fill: #333333;
}

.infoC {
	fill: #333333;
}

.radarInvisibleCircle{
	cursor: pointer;
}
